import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import AdminDashboard from "./components/AdminDashboard/AdminDashboard"; // Ensure this path is correct
import InterviewPage from "./components/UserDashboard/Interviewpage"; // Ensure this path is correct
import CandidateDashboard from "./components/UserDashboard/CandidateDashboard";
import MySimulations from './components/UserDashboard/MySimulations';
import Dashboard from './components/Dashboard'
import Userlogin from './components/UserDashboard/Userlogin'
import UserSignup from './components/UserDashboard/UserSignup'


function App(){
  return (
    <Router>
      <Routes>
        <Route path="/Interviewpage" element={<InterviewPage />} />
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/CandidateDashboard" element={<CandidateDashboard />} />
        <Route path="/MySimulations" element={<MySimulations />} />
        <Route path="/" element={<Dashboard />} />
        <Route path="/UserSignup" element={<UserSignup />} />
      </Routes>
    </Router>
  );
}

export default App;
